        window.alert('คุณกำลังกด Down' +title);
    };
    

    const showData = () => {{
        return (
        <div>
            <li>Hello</li>
            <li>World</li>
        </div>
    )}
    return(
       <div>
           <p> {title} </p>
            <button className="text-white p-2 font-bold bg-green-500 rounded-sm mr-2">Start</button>
            <button className="text-white p-2 font-bold bg-gray-500 rounded-sm mr-2">Resatart</button>
            <button className="text-white p-2 font-bold bg-red-500 rounded-sm mb-2">Down</button>
            <p>{showData()}</p>          
       </div>
    )}
   }
